  return (
    <div>
      <div>{dummy_post.postTitle}</div>
      <div>
        {dummy_post.postAuthor}, {dummy_post.postDate}
      </div>
      <div>{dummy_post.postContent}</div>
      <div>돌아가기 버튼</div>
      <br />
      <br />
      {/* 게시물 페이지 글 제목, 작성자, 작성일, 글 내용 게시판으로 돌아가기 버튼
      댓글작성자, 댓글 내용, 댓글 작성일 댓글 입력상자, 댓글 작성 버튼 */}
    </div>
  );
}
export default Post;
